import React, { useEffect, useState } from "react";
import Header from "../../components/Header/Header";
import Layouts from "../../components/Layouts/Layouts";
import { MainContent } from "../../components/MainContent/MainContent";
import { FaTrash } from "react-icons/fa";
import { RiEdit2Fill } from "react-icons/ri";
import { IoEye } from "react-icons/io5";
import { NavLink } from "react-router-dom";
import api from "../../common/api/api";
import { IUser } from "../../interface/User/IUser";
const Users = () => {
  const [users, setUser] = useState<IUser[]>([]);

  const fetchUsers = () => {
    api
      .get("users")
      .then((res) => {
        setUser(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    fetchUsers();
  }, []);
  return (
    <Layouts>
      <Header />
      <MainContent>
        <section className="bg-slate-50 text-slate-600 my-5 rounded-lg overflow-x-auto scroll-none">
          <table className="table-fixed w-full">
            <thead className="text-left bg-green-500 text-slate-50">
              <tr className="font-montserrat-bold">
                <th className="w-16 px-5 py-2 rounded-tl-lg rounded-bl-lg">
                  ID
                </th>
                <th className="w-32 px-5 py-2">Ady</th>
                <th className="w-48 px-5 py-2">Famili√Ωasy</th>
                <th className="w-32 px-5 py-2">Telefon belgisi</th>
                <th className="w-32 px-5 py-2">Email</th>
                <th className="w-28 px-5 py-2">Wezipe</th>
                <th className="w-48 px-5 py-2 rounded-tr-lg rounded-br-lg">
                  Sazlamalar
                </th>
              </tr>
            </thead>
            <tbody>
              {users.map((user, index) => {
                return (
                  <tr
                    key={index}
                    className="border-green-500 border-b  rounded-3xl last:border-none"
                  >
                    <td className="px-5 py-2">{user.id}</td>
                    <td className="px-5 py-2">{user.firstName}</td>
                    <td className="px-5 py-2">{user.lastName}</td>
                    <td className="px-5 py-2">{user.phone}</td>
                    <td className="px-5 py-2">{user.email}</td>
                    <td className="px-5 py-2">{user.verification_code}</td>
                    <td className="px-5 py-2">
                      <div className="flex items-center">
                        <button className="cursor-pointer w-10 h-10 mr-2  text-blue-500 hover:bg-blue-500 hover:text-white duration-500 flex justify-center items-center rounded-xl">
                          <RiEdit2Fill size={18} />
                        </button>
                        <button
                          type="button"
                          className="cursor-pointer w-10 h-10  text-red-500 hover:bg-red-500 hover:text-white duration-500 flex justify-center items-center rounded-xl"
                        >
                          <FaTrash size={16} />
                        </button>
                      </div>
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </section>
      </MainContent>
    </Layouts>
  );
};

export default Users;
